import React from 'react';
import Navbar from '../../components/Navbar';
import Button from 'react-bootstrap/Button';
import $ from 'jquery';
import '../../css/App.css';
import { useEffect } from 'react';
import colorspectrum from '../../images/resized/Spectrum.png';
import exampleImage from '../../images/resized/Zebra.jpg';
import { useNavigate } from 'react-router-dom';

const Home = () => {
	useEffect(() => {
		createPixelMask();
	}, [])

	let navigate = useNavigate();

	function createPixelMask(){
		var table = document.getElementById("pixel_Table");
		var row;
		var cell;
    	for(var i=0;i<8;i++){
			row = table.insertRow(i);
      		for(var j=0;j<8;j++){
			    cell = row.insertCell(j);
			    cell.addEventListener('click', IncreaseOpacity);
				cell.addEventListener('contextmenu', DecreaseOpacity)
        	}
    	}

    	document.getElementById("pixel_Table").style.backgroundImage = 'url(' + exampleImage + ')';
    }
		
	function DecreaseOpacity(event) {
		event.preventDefault()
		var opacity_level = parseFloat($(event.target).css("opacity"));
		if (opacity_level > "0.0") {
			opacity_level = opacity_level - 0.30;
			$(event.target).css("opacity", opacity_level);
		}
	}
		
	function IncreaseOpacity(event) {
		var opacity_level = parseFloat($(event.target).css("opacity"));
		if (opacity_level < "0.9") {
			opacity_level = opacity_level + 0.30;
			$(event.target).css("opacity", opacity_level);
		}	
	}

    return (
        <div className="home">		
            <Navbar/>
            <div style={{height: "40vw", position: "relative"}}>
                <div style={{position: "absolute", top: "50%", left: "50%", transform: "translate(-50%, -50%)", textAlign: "center"}}>
					<div class="row">
						<div style={{float: "left", width: "50%", textAlign: "left"}}>
							<p>Enk√§ten best√•r av 5 bilder, d√§r du som respondent med hj√§lp av ett rutn√§t f√•r markera vilka delar av bilden du nyttjar f√∂r att identifiera ett djur p√• en bild, samt hur viktig varje ruta √§r f√∂r identifieringen. Du beh√∂ver inte ha n√•gra f√∂rkunskaper inom AI f√∂r att utf√∂ra enk√§ten. Det vi √§r intresserade av √§r hur du som m√§nniska resonerar.</p>
							<br></br>
							<p>Ditt uppdrag √§r inte att identifiera djuren, utan att indikera vilka delar av en bild du beh√∂ver, och till vilken grad, f√∂r att utf√∂ra identifikationen. Detta g√∂r du genom att klicka p√• rutorna i bilden. Det finns 4 niv√•er av markering, d√§r ingen markering √§r niv√• 1. V√§nsterklick √∂kar niv√•n f√∂r en ruta med ett steg, medan h√∂gerklick minskar ett steg. H√∂gre niv√• indikerar att rutan √§r viktigare f√∂r att kunna identifiera djuret.</p>
							<br></br>
							<p>P√• exemplet nedan kan du klicka runt och testa hur unders√∂kningen kommer att fungera. P√• samtliga bilder f√•r du markera hur m√•nga rutor du vill (dock minst en), och helt fritt markera vilka niv√•er som helst i vilken kombination som helst.</p>
							<br></br>
							<p>Har du fr√•gor innan du p√•b√∂rjar enk√§ten kan du kontakta oss p√• <u>X</u></p>
							<br></br>	
						</div>
						<div style={{float: "left", width: "50%"}}>
							<h5>Exempel bild</h5>
							<table id="pixel_Table"></table>
							<figure>
							<img src={colorspectrum} alt="Spektrum" />
								<figcaption><h5>Gradskala</h5></figcaption>
							</figure>
							<br></br>
							<p>
							Tryck p√• ‚ÄúStarta enk√§ten‚Äù n√§r du √§r redo.
							</p>
							<br></br>
							<Button variant="outline-secondary" onClick={() => {
								navigate('/survey');
							}}
							>Starta enk√§ten</Button> 	
						</div>
					</div>
					
                </div> 
            </div>          
        </div>
    )
}

export default Home;
